-- Row-Level Security policies for service connection reliability tables
-- Applies to tables created in the 042-setup-and-connect initiative.
-- Execute via Supabase SQL or include in automated migrations.

-- Helper predicate: returns true when the current auth user belongs to the team that owns the service connection.
create or replace function public.is_team_member_for_connection(connection_id uuid)
returns boolean
language sql
stable
security definer
set search_path = public
as $$
  select exists (
    select 1
    from public.service_connection_profiles sc
    join public.team_members tm on tm.team_id = sc.team_id
    where sc.id = connection_id
      and tm.user_id = auth.uid()
  );
$$;

-- Guard execution of the helper so only authenticated contexts can call it.
revoke all on function public.is_team_member_for_connection(uuid) from public;
grant execute on function public.is_team_member_for_connection(uuid) to authenticated;
grant execute on function public.is_team_member_for_connection(uuid) to service_role;

-- Enable RLS across all reliability tables/views.

alter table public.service_connection_profiles enable row level security;
alter table public.diagnostic_test_runs enable row level security;
alter table public.error_events enable row level security;
alter table public.service_connection_heartbeats enable row level security;
alter table public.service_health_snapshots enable row level security;

-- service_connection_profiles policies
drop policy if exists "Service connections readable by team" on public.service_connection_profiles;
drop policy if exists "Service connections manageable by team" on public.service_connection_profiles;
create policy "Service connections readable by team" on public.service_connection_profiles
  for select using (
    auth.role() = 'service_role'
    or exists (
      select 1
      from public.team_members tm
      where tm.team_id = service_connection_profiles.team_id
        and tm.user_id = auth.uid()
    )
  );

create policy "Service connections manageable by team" on public.service_connection_profiles
  for all using (
    auth.role() = 'service_role'
    or exists (
      select 1
      from public.team_members tm
      where tm.team_id = service_connection_profiles.team_id
        and tm.user_id = auth.uid()
    )
  ) with check (
    auth.role() = 'service_role'
    or exists (
      select 1
      from public.team_members tm
      where tm.team_id = service_connection_profiles.team_id
        and tm.user_id = auth.uid()
    )
  );

-- diagnostic_test_runs policies
drop policy if exists "Diagnostics readable by connection team" on public.diagnostic_test_runs;
drop policy if exists "Diagnostics insert restricted to team" on public.diagnostic_test_runs;
drop policy if exists "Diagnostics update restricted to team" on public.diagnostic_test_runs;
create policy "Diagnostics readable by connection team" on public.diagnostic_test_runs
  for select using (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(diagnostic_test_runs.service_connection_id)
  );

create policy "Diagnostics insert restricted to team" on public.diagnostic_test_runs
  for insert with check (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(service_connection_id)
  );

-- Allow updates (e.g., marking completion) only for team members or service role
create policy "Diagnostics update restricted to team" on public.diagnostic_test_runs
  for update using (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(diagnostic_test_runs.service_connection_id)
  ) with check (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(service_connection_id)
  );

-- error_events policies
drop policy if exists "Error events readable by connection team" on public.error_events;
drop policy if exists "Error events writable by team" on public.error_events;
create policy "Error events readable by connection team" on public.error_events
  for select using (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(error_events.service_connection_id)
  );

create policy "Error events writable by team" on public.error_events
  for all using (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(error_events.service_connection_id)
  ) with check (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(service_connection_id)
  );

-- service_connection_heartbeats policies
drop policy if exists "Heartbeats readable by connection team" on public.service_connection_heartbeats;
drop policy if exists "Heartbeats insert restricted to service role" on public.service_connection_heartbeats;
drop policy if exists "Heartbeats update restricted to service role" on public.service_connection_heartbeats;
create policy "Heartbeats readable by connection team" on public.service_connection_heartbeats
  for select using (
    auth.role() = 'service_role'
    or public.is_team_member_for_connection(service_connection_heartbeats.service_connection_id)
  );

create policy "Heartbeats insert restricted to service role" on public.service_connection_heartbeats
  for insert with check (
    auth.role() = 'service_role'
  );

create policy "Heartbeats update restricted to service role" on public.service_connection_heartbeats
  for update using (auth.role() = 'service_role')
  with check (auth.role() = 'service_role');

-- service_health_snapshots policies (materialized view)
drop policy if exists "Health snapshots readable by connection team" on public.service_health_snapshots;
create policy "Health snapshots readable by connection team" on public.service_health_snapshots
  for select using (
    auth.role() = 'service_role'
    or exists (
      select 1
      from public.service_connection_profiles sc
      join public.team_members tm on tm.team_id = sc.team_id
      where sc.id = service_health_snapshots.service_connection_id
        and tm.user_id = auth.uid()
    )
  );
